    .loader_c {
        position: absolute;
        top: 0;
        left: 0;
        width: 100vw;
        height: 100vh;
        background: #1C1D5A;
        z-index: 20;
    }

    .loader::before,
    .loader::after {
        content: "";
        display: block;
        position: absolute;
    }

    .loader::before {
        top: 0;
    }

    .loader::after {
        bottom: 0;
    }

    @keyframes blink {
        0% {
            opacity: 1;
        }
        99% {
            opacity: 0;
        }
        100% {
            opacity: 0;
        }
    }

    .loader_c.custom {
        background-size: 100% 100%;
    }

    .loader {
        background: var(--logo-image) top center/auto 100% no-repeat;
        background-size: contain;
        position: absolute;
        left: 50%;
        transform: translate(-50%, -50%);
        max-height: 80vh;
        width: 70%;
        filter: drop-shadow(0px 3px 3px rgb(0 0 0 / 1));
    }

    .loader.custom.no_img:before,
    .loader.custom.no_img::after {
        /*border-radius: 40px;*/
        width: 100%;
        margin: 0 auto;
        background-size: 100% 100%;
        background-repeat: repeat-x;
        z-index: 22;
        box-sizing: border-box;
        border: solid 0.1em #e4e4e4;
    }

    .loader.custom.no_img::after {
        width: 100%;
        box-shadow: inset 0 0.1em 0.1em rgba(255, 255, 255, 0.45);
        background: var(--fill);
        top: 140.5%;
    }

    .loader.custom.no_img::before {
        width: 102%;
